import React from "react";
import { Typography, Box } from "@mui/material";
import FileUpload from "./FileUpload"; // Import the FileUpload component

function Home() {
  return (
    <Box
      sx={{
        height: "100vh", // Set height to 100vh
        display: "flex",
        flexDirection: "column",
        justifyContent: "top",
        alignItems: "center",
      }}
    >
      <Typography
        variant="h5"
        sx={{
          fontFamily: "Rubik",
          fontSize: "4rem",
          color: "lightblack",
          marginBottom: "20px",
        }}
      >
        Welcome To SuperSonics
      </Typography>
      {/* Render the FileUpload component */}
      <FileUpload />
    </Box>
  );
}

export default Home;
